INSERT INTO `baypas` (`id`, `package_code`, `package_name`, `package_description`, `package_harga`, `available_payment_methods`, `kelompok`) VALUES
(11, 'c03be70fb3523ac2ac440966d3a5920e', '[Method E-Wallet] Xtra Combo Special 8GB Disc (1GB-8GB)', '- XL Xtra Combo Special Up to (hingga) 8 GB tergantung Area / 30 Hari harga murah/diskon. Kuota yang didapat akan bervariasi tergantung TKP/Area. Karena beda dengan paket akrab, maka kami tidak bisa memastikan dapat berapa GB, bisa dari 1GB hingga 8GB. Jangan kaget apabila nanti ada yang dapat kuota 1GB/2GB/3GB/4GB/5GB/6GB/7GB/8GB. Membeli = SETUJU ya.\r\n- Dapat digunakan untuk syarat aktivasi Paket XL Unlimited Turbo di aplikasi MyXL untuk kebutuhan inject/trik internet murah menggunakan SSH/VPN.\r\n- Kartu jangan posisi masa tenggang saat ditembak.\r\n- Sediakan saldo E-wallet Dana Rp25.000 (Akan terpotong segini). Klik tombol Bayar ketika sudah Beli Paket.\r\n- Terdapat fee/biaya Admin (tertera) untuk mendukung sewa server kami.', 5000, '[{\"order\":1,\"payment_method\":\"DANA\",\"payment_method_display_name\":\"Metode DANA\",\"desc\":\"Bisa dibayar dengan menggunakan E-Wallet DANA\"},{\"order\":2,\"payment_method\":\"QRIS\",\"payment_method_display_name\":\"Metode QRIS\",\"desc\":\"Bisa dibayar di semua e-wallet \\/ mbanking yang telah mendukung fitur pembayaran QRIS\"}]', ''),
(12, 'bdb392a7aa12b21851960b7e7d54af2c', '[Method Pulsa] Xtra Combo Special Disc (yang Metode Pulsa tidak ada kuotanya, hanya untuk bahan Addon XUT Semua Addons)', '- XL Xtra Combo Special 30 Hari harga murah/diskon. TIDAK ADA KUOTA UTAMA/REGULERNYA SAMA SEKALI. Membeli = SETUJU ya.\r\n- Khusus digunakan untuk syarat aktivasi Paket XL Unlimited Turbo di aplikasi MyXL untuk kebutuhan inject/trik internet murah menggunakan SSH/VPN.\r\n- Kartu jangan posisi masa tenggang saat ditembak.\r\n- Sediakan Pulsa Rp25.000 (Akan terpotong segini).\r\n- Terdapat fee/biaya Admin (tertera) untuk mendukung sewa server kami.', 5000, '[{\"order\":1,\"payment_method\":\"BALANCE\",\"payment_method_display_name\":\"Metode Pulsa (BALANCE)\",\"desc\":\"Langsung memotong pulsa kamu jika paket membutuhkan Pulsa (baca dan pahami deskripsi paketnya)\"}]', ''),
(13, 'XLXCS8GB_PREV', 'XL Xtra Combo Special 8GB (1GB-8GB) 30 Hari Non Discount (Sedia Saldo Panel)', '- XL Xtra Combo Special Up to (hingga) 8 GB tergantung Area / 30 Hari harga normal. Kuota yang didapat akan bervariasi tergantung TKP/Area. Karena beda dengan paket akrab, maka kami tidak bisa memastikan dapat berapa GB, bisa dari 1GB hingga 8GB. Jangan kaget apabila nanti ada yang dapat kuota 1GB/2GB/3GB/4GB/5GB/6GB/7GB/8GB. Membeli = SETUJU ya.\r\n- Dapat digunakan untuk syarat aktivasi Paket XL Unlimited Turbo di aplikasi MyXL untuk kebutuhan inject/trik internet murah menggunakan SSH/VPN.\r\n- Kartu jangan posisi masa tenggang saat ditembak.\r\n- Terdapat fee/biaya Admin (tertera). Sediakan saldo panel untuk menembak, tidak perlu repot sediakan pulsa.', 5000, '[{\"order\":1,\"payment_method\":\"BALANCE\",\"payment_method_display_name\":\"Metode Pulsa (BALANCE)\",\"desc\":\"Langsung memotong pulsa kamu jika paket membutuhkan Pulsa (baca dan pahami deskripsi paketnya)\"}]', ''),
(16, 'XL_XC1PLUS1DISC_PULSA', '[Method Pulsa] Xtra Combo 1+1GB Disc (Gandengan XUT Super 30000)', '- Ini bukan Xtra Combo Special ya.. Beda lagi...\r\n- XL Xtra Combo 1+1GB / 30 Hari harga murah/diskon. Kuota yang didapat akan bervariasi tergantung TKP/Area.\r\n- Dapat digunakan untuk syarat aktivasi Paket XL Xtra Unlimited Turbo Super (XUT SUPER) 30000\r\n- Kartu usahakan jangan posisi masa tenggang saat ditembak.\r\n- Sediakan Pulsa Rp12.500 (Akan terpotong segini).\r\n- Terdapat fee/biaya Admin (tertera) untuk mendukung sewa server kami.', 5000, '[{\"order\":1,\"payment_method\":\"BALANCE\",\"payment_method_display_name\":\"Metode Pulsa (BALANCE)\",\"desc\":\"Langsung memotong pulsa kamu jika paket membutuhkan Pulsa (baca dan pahami deskripsi paketnya)\"}]', ''),
(87, 'XLUNLITURBOVIU_PULSA', '[Method Pulsa] Unlimited Turbo Viu untuk Xtra Combo', '- Xtra Unlimited Turbo Viu untuk akses Viu ketika semua kuota utama paket habis.\r\n- Masa Aktif mengikut paket Xtra Combo Special 8GB/14GB yang dapat ditembak di panel tembak XL Reborn ini (wajib ditembak dulu paket Xtra Combo Special 8GB/14GB nya).\r\n- Dapat dipakai untuk Inject SSH/VPN (bagi yang tau-tau saja).\r\n- FUP paket sekitar 100-150GB an (random/acak tergantung kartu XL dan lokasi kamu). Jika terkena FUP, saat diinject untuk VPN akan terasa lemot/tidak bisa konek. Solusinya adalah bisa tembak ulang paket Xtra Unlimited Turbo ini maka FUP akan reset.\r\n- Sediakan Pulsa minimal Rp25.000 (Akan terpotong segini).\r\n- Jika untuk trik XUT Addon, sebaiknya gunakan pulsa di bawah 10K (tetep nanti harus digandeng Xtra Combo Special 8GB).', 1000, '[{\"order\":1,\"payment_method\":\"BALANCE\",\"payment_method_display_name\":\"Metode Pulsa (BALANCE)\",\"desc\":\"Langsung memotong pulsa kamu jika paket membutuhkan Pulsa (baca dan pahami deskripsi paketnya)\"}]', ''),
(88, 'XLUNLITURBOTIKTOK_PULSA', '[Method Pulsa] Unlimited Turbo TikTok untuk Xtra Combo', '- Xtra Unlimited Turbo TikTok untuk akses TikTok ketika semua kuota utama paket habis.\r\n\r\n- Khusus untuk trik XUT Addon, silakan tembak paket ini sampai muncul notif \"Paket berhasil dibeli. Silakan cek kuotanya....\". JIKA NOTIF PERTAMA \"Paket berhasil dibeli. Silakan cek kuotanya....\" MAKA BERIKAN JEDA SEKITAR 10 MENIT.\r\n\r\nSEMBARI MENUNGGU 10 MENIT, KAMU MUNGKIN BISA LANJUT KE ADDON LAINNYA AGAR TIDAK SALING TUNGGU, INTINYA JIKA PERTAMA MUNCUL NOTIF \"Paket berhasil dibeli...\" maka tunggu juga selama 10 menit.\r\n\r\nSETELAH ITU, BELI LAGI HINGGA MUNCUL NOTIF \"422 -> Failed call ipaas purchase, with status code:422 : null,\" (DIPAKSA) DI MASING MASING ADDON. INI TUJUAN YANG KITA CARI-CARI, HARUS ADA RESPON 422 SEPERTI INI.\r\n\r\nDI PALING AKHIR JIKA SEMUA ADDON SUDAH DIRITUALKAN DAN DAPAT RESPON \"422 -> Failed call ipaas purchase, with status code:422 : null,\", TINGGAL GANDENG DENGAN XTRA COMBO SPECIAL 8GB, DAN TUNGGU SELAMA MAX 1-2 JAM NANTI SEMUA ADDON AKAN MASUK. SELAMA MASA TUNGGU 1-2 JAM, SEBAIKNYA JANGAN BELI PAKET APA-APA LAGI DULU.\r\n\r\nSEBELUM MELAKUKAN RITUAL DI ATAS, PASTIKAN TIDAK ADA XTRA COMBO APAPUN, WAJIB CEK VIAL DIAL *808# > INFO > INFO Kartu XL-Ku > Stop Langganan. Unreg sampai bersih dari berbau Xtra Combo 100GB, Xtra Combo Plus, Xtra Combo VIP Plus, Xtra Hotrod, dan sejenisnya (kalau Xtra Combo Flex biarkan saja).\r\n\r\n- Jika untuk trik XUT Addon, sebaiknya gunakan pulsa di bawah 10K (tetep nanti harus digandeng Xtra Combo Special 8GB).', 1000, '[{\"order\":1,\"payment_method\":\"BALANCE\",\"payment_method_display_name\":\"Metode Pulsa (BALANCE)\",\"desc\":\"Langsung memotong pulsa kamu jika paket membutuhkan Pulsa (baca dan pahami deskripsi paketnya)\"}]', ''),
(89, 'XLUNLITURBONETFLIXXC_PULSA', '[Method Pulsa] Unlimited Turbo Netflix untuk Xtra Combo', '- Xtra Unlimited Turbo Netflix untuk akses Netflix secara Unlimited.\r\n- Masa Aktif mengikuti paket Xtra Combo Special 8GB/14GB yang dapat ditembak di panel tembak XL Reborn ini.\r\n- Dapat dipakai untuk Inject SSH/VPN (bagi yang tau-tau saja).\r\n- FUP paket random/acak tergantung kartu XL dan lokasi kamu. Jika terkena FUP, saat diinject untuk VPN akan terasa lemot/tidak bisa konek. Solusinya adalah bisa tembak ulang paket Xtra Unlimited Turbo ini maka FUP akan reset.\r\n- Sediakan Pulsa Rp25.000 (Akan terpotong segini).\r\n- Jika untuk trik XUT Addon, sebaiknya gunakan pulsa di bawah 10K (tetep nanti harus digandeng Xtra Combo Special 8GB).', 1000, '[{\"order\":1,\"payment_method\":\"BALANCE\",\"payment_method_display_name\":\"Metode Pulsa (BALANCE)\",\"desc\":\"Langsung memotong pulsa kamu jika paket membutuhkan Pulsa (baca dan pahami deskripsi paketnya)\"}]', ''),
