INSERT INTO `events_tournament_game` (`id`, `name`, `description`, `min_team_player`, `max_team_player`, `mode`, `registration_fee`, `status`, `banner`, `started_at`, `finished_at`) VALUES
(3, 'VIOLET VAGANZA BRONZE', 'Ikuti keseruan Program VIOLET VAGANZA (Bronze) dimana hanya dengan Rp. 15.000,- Kamu berkesempatan mendapatkan Hadiah Utama berupa Saldo sebesar Rp. 500.000,-\r\n\r\nSyarat dan Ketentuan :\r\n1. Program berlangsung dimulai pada tanggal 15 Agustus dan ditutup pada tanggal 31 Agustus 2022.\r\n\r\n2. Pengguna yang ingin berpartisipasi dalam Program VIOLET VAGANZA (Bronze) wajib membeli tiket seharga Rp 15.000,- untuk 1 kali keikutsertaan.\r\n\r\n3. Program VIOLET VAGANZA akan ditutup pada tanggal 31 Agustus 2022 pukul 20.00 WIB dan akan langsung dilakukan pengundian pemenang.\r\n\r\n4. Pemenang akan diumumkan pada tanggal 31 Agustus 2022 pada pukul 21.00 WIB.\r\n\r\n5. Para pemenang akan langsung menerima notifikasi melalui aplikasi / whatsapp / email perihal kemenangannya.\r\n\r\n6. Pemenang akan menerima Hadiah Saldo VIOLET pada tanggal 01 September 2022.\r\n\r\n7. Detail besaran Hadiah Pemenang (Bronze) :\r\nA. Pemenang #1 : Saldo sebesar Rp. 500.000,-\r\nB. Pemenang #2, #3, #4, dan #5 : Saldo sebesar Rp. 250.000,-\r\nC. Pemenang #6 s.d. #20 : Saldo sebesar Rp. 150.000,-\r\nD. Pemenang #21 s.d. #100 : Saldo sebesar Rp. 50.000,-\r\n\r\n8. Pada Kategori VIOLET VAGANZA BRONZE, program dapat menerima 500 pengguna yang ikut serta.\r\n\r\n9. Apabila hingga 31 Agustus 2022 pukul 20.00 WIB kuota 500 pengguna belum terpenuhi, maka program VIOLET VAGANZA tetap akan ditutup dan dilakukan pengundian pemenang.\r\n\r\n10. Apabila kuota sebanyak 500 telah terpenuhi sebelum 31 Agustus 2022 pukul 20.00 WIB maka program VIOLET VAGANZA (Bronze) ditutup lebih cepat dan akan dilakukan pengundian pemenang di keesokan harinya pada pukul 20.00 WIB dan pengumuman pemenang pada pukul 21.00 WIB.\r\n\r\n11. Bagi para pemenang, Saldo Pembelian Tiket keikutsertaan (Rp. 15.000,-) tidak dapat dikembalikan.\r\n\r\n12. Bagi para pengguna yang belum beruntung, Saldo Pembelian Tiket keikutsertaan akan dikembalikan secara utuh (Rp. 15.000,-) ditambah Saldo Hiburan sebesar Rp. 10.000,- ke saldo pengguna.', 0, 500, 'Solo', 15000, 'Open', '722252130_4_20220815_224756_0000.jpg', '2023-08-15', '2030-08-30'),
