INSERT INTO `information` (`id`, `date`, `type`, `title`, `content`, `image`) VALUES
(26, '2022-12-16 02:21:33', 'news', 'Transaksi Khusus Produk Telkomsel', 'Hai Mitra Solusi Payment\r\nDengan ini kami informasikan terkait pengisian voucher data telkomsel yang terbagi beberapa zona/wilayah. Sebelum melakukan pengisian, silahkan kunjungi link \" https://www.telkomsel.com/voucherfisik \" tersebut untuk mengetahui detail zona wilayah anda .\r\n\r\nHormat kami :\r\nTechnical Support\r\nSolusi Payment ', '{\"data\":null}'),
(27, '2022-12-16 02:24:22', 'info', 'Nomor Kartu Solusi Payment ( Card Member )', 'Nomor yang tertera pada Kartu Solusi Payment Kamu adalah nomor rekening Solusi Payment Kamu. Untuk saat ini, Nomor Rekening Solusi Payment dapat digunakan untuk menerima pengiriman saldo dari Teman Kamu. Kamu juga bisa mengirimkan Saldo kepada Teman Kamu dengan menggunakan Nomor Rekening yang tertera pada Kartu Solusi Payment milik Teman Kamu.', '{\"data\":null}'),
(28, '2022-12-16 02:28:04', 'maintenance', 'Maintenance Harian', 'Dengan ini kami informasikan kepada seluruh mitra pada jam 23:45 - 00:15 WIB, transaksi pada aplikasi tidak dapat proses .\n\nHal ini ini dikarenakan pada jam tersebut sistem sedang melakukan rekapan harian .\n\nMohon dikondisikan ðŸ™ðŸ™\n\nHormat Kami\n\nTechnical Support\n( Solusi Payment )', '{\"data\":null}');
