INSERT INTO `news_promo` (`id`, `title`, `description`, `banner`, `created_at`, `updated_at`, `expired_at`) VALUES
(16, 'Ajak Teman Dan Raih Saldo Rp. 20.000,-', 'Ajak Teman Kamu bergabung di Violet Payment. Kamu akan mendapatkan Reward Saldo Rp. 15.000,- dan Teman Kamu akan mendapatkan Reward Rp. 5.000,-\r\n\r\n(Pembaharuan S&amp;K efektif mulai 01 Oktober 2023 )\r\n\r\nSyarat dan Ketentuan :\r\n\r\n1. Periode program : 01 s.d. 31 Oktober 2023.\r\n2. Program berlaku untuk seluruh pengguna.\r\n3. Teman yang diajak wajib memasukan Kode Referral milik pengajak saat mendaftar.\r\n4. Pengajak akan mendapatkan Saldo sebesar Rp. 15.000,-.\r\n5. Teman yang diajak akan mendapatkan Saldo sebesar Rp. 5.000,-.\r\n6. Agar pengajak dan teman yang diajak eligible mendapatkan Saldo Referral, wajib melakukan misi berikut :\r\n\r\nUntuk Pengajak :\r\n\r\n6 a. Pengajak wajib memiliki saldo dengan jumlah minimal  Rp. 100.000,- selama program berlangsung\r\n6 b. Pengajak wajib telah memiliki riwayat transaksi sebanyak minimal 5 kali\r\n6 c. Apabila pada satu hari pukul 23.59 WIB pengajak tidak memiliki saldo sesuai dengan poin (6a) maka teman yang di ajak di hari tersebut tidak eligible atau tidak memenuhi persyaratan program dan teman yang diajak di hari tersebut tidak dihitung\r\n\r\nUntuk Teman Yang Diajak :\r\n\r\n6 d. Teman yang diajak wajib melakukan topup saldo sebesar Rp. 50.000,- di hari yang sama dengan hari pendaftaran\r\n6 e. Teman yang diajak wajib melakukan transaksi apapun minimal 10 kali dengan nominal berapapun di hari yang sama dengan hari pendaftaran\r\n6 f. Teman yang diajak wajib memiliki saldo  dengan jumlah minimal Rp. 30.000,- pada pukul 23.59 WIB di hari yang sama dengan hari pendaftaran.\r\n\r\n7. Reward Saldo Referral akan diberikan secara akumulasi tiap Minggu dan disalurkan ke saldo pengguna pada setiap hari Minggu di setiap pekannya.\r\n8. Pengajak dapat mengajak teman hingga maksimal 100 teman per periode.\r\n9. Violet Payment berhak untuk merubah, menambahkan, mengurangi syarat dan ketentuan pada program ini apabila diperlukan, dengan atau tanpa pemberitahuan terlebih dahulu.\r\n10. Program ini tidak dipungut biaya apapun. Harap berhati-hati kepada pihak yang mengatasnamakan Violet Payment.\r\n11. Violet Payment akan menghanguskan bonus, jika mitra ketahuan melakukan kecurangan dalam program ini. Dan keputusan ini mutlak tidak dapat di ganggu gugat dari pihak manapun.\r\n12. Hubungi Layanan Bantuan untuk informasi lebih lanjut\r\n\r\nEmail : admin@lapaxdigital.com\r\nWhatsapp : 0895 2309 0952\r\n\r\nHormat kami\r\nTechnical Finance Violet Payment', '737625259_20231002_114323_0000.jpg', '2022-08-16 13:55:09', '2022-08-16 13:55:09', '2023-10-31'),
(28, 'Maintenance Server', 'Dengan ini kami informasikan bahwa pada jam 23:30 - 00:15 WIB. Transaksi tidak dapat kami proses di antara nya :\r\n- Transaksi Topup Saldo\r\n- Transaksi Pembelian \r\n\r\nHal tersebut kami lakukan setiap harian nya . Jadi mohon untuk dikondisikan ðŸ™ðŸ™.\r\n\r\nHormat kami\r\nTechnical Support Violet Payment', '990925414_20231002_103017_0000.jpg', '2022-10-13 07:48:29', '2022-10-13 07:48:29', NULL),
(29, 'Masa Berlaku Tiket Deposit', 'Dengan ini kami informasikan bahwa masa berlaku tiket Deposit hanya sampai jam 23:45 WIB ( Terhitung di hari yang sama saat pengambilan tiket Deposit ) Lewat batas tersebut maka saldo akan di input 7x24 Jam.\r\n\r\nMohon dikondisikan dan kerjasamanya ðŸ™ðŸ™\r\n\r\nHormat kami\r\nTechnical Finance Violet Payment', '998858906_20231002_095432_0000.jpg', '2022-10-15 19:45:53', '2022-10-15 19:45:53', NULL),
(30, 'Saldo Refund 100%', 'Hai Mitra MC Payment\r\n\r\nDengan ini kami informasikan, bahwa saldo anda akan kami refund 100% jika mengalami beberapa hal di bawah ini :\r\n\r\nâœ… Jika Transaksi gagal \r\nâœ… Jika transaksi sukses, namun pulsa tidak masuk ke no tujuan ( Kami akan Refund setelah mendapatkan informasi tidak valid dari operator / provider )\r\n\r\nHormat kami \r\nTechnical Support MC Payment', '1139331356_1696214558484.jpg', '2022-11-20 08:56:52', '2022-11-20 08:56:52', NULL);
