INSERT INTO `paket_xl` (`id`, `package_code`, `package_name`, `package_description`, `package_harga`, `available_payment_methods`, `category`, `kelompok_id`, `kelompok`) VALUES
(1, 'b0012edd21983678eb7ebc08d8f04ecd', 'Masa Aktif Kartu XL 1 Tahun', '<b>JANGAN BARBAR ATAU SAYA TUTUP, SOALNYA COCOK TERUTAMA BUAT JAGA MASA AKTIF PENGELOLA PAKET AKRAB</b>\r\n\r\n- Masa aktif selama 1 tahun (12 bulan).\r\n- Jangan kaget jika masa aktif kartu tidak langsung bertambah. Masa aktif akan diperpanjang setiap bulan, tidak langsung dapat 1 tahun (12 bulan). Pemicu perpanjangan masa aktif kartu nanti saat paket setahun perpanjangan Rp0 pada tanggal xx xx xxxx 00.00 WIB. Akan tambah 30 hari tiap bulannya.\r\nJika kartunya mendekati masa tenggang, sebaiknya bisa tembak masa aktif sebulan dulu yang ada di panel.\r\n- Tidak dapat diakumulasi.\r\n- Tidak bisa dalam keadaan masa tenggang. Jika sudah terlanjur masa tenggang, tembak masa aktif sebulan di panel.\r\n- Sisa pulsa boleh dalam posisi Rp0 (kosongan).\r\n- Terdapat fee/biaya pembelian paket ini untuk mendukung biaya infrastruktur server kami (tertera).\r\n- NO GARANSI.', 0, '[{\"order\":1,\"payment_method\":\"BALANCE\",\"payment_method_display_name\":\"Metode Pulsa (BALANCE)\",\"desc\":\"Langsung memotong pulsa kamu jika paket membutuhkan Pulsa (baca dan pahami deskripsi paketnya)\"}]', 'Internet', NULL, ''),
(2, 'XL_XC1PLUS1DISC_EWALLET', '[Method E-Wallet] Xtra Combo 1+1GB Disc (Gandengan XUT Super 30000 saja)', '- Ini bukan Xtra Combo Special ya.. Beda lagi...\r\n- XL Xtra Combo 1+1GB / 30 Hari harga murah/diskon. Kuota yang didapat akan bervariasi tergantung TKP/Area.\r\n- Dapat digunakan untuk syarat aktivasi Paket XL Xtra Unlimited Turbo Super (XUT SUPER) 30000 (hanya yang XUT SUPER 30000 saja bukan yang 8500)\r\n- Kartu usahakan jangan posisi masa tenggang saat ditembak.\r\n- Sediakan saldo E-wallet Rp12.500 (Akan terpotong segini). Klik tombol Bayar ketika sudah Beli Paket.\r\n- Terdapat fee/biaya Admin (tertera) untuk mendukung sewa server kami.', 0, '[{\"order\":1,\"payment_method\":\"DANA\",\"payment_method_display_name\":\"Metode DANA\",\"desc\":\"Bisa dibayar dengan menggunakan E-Wallet DANA\"},{\"order\":2,\"payment_method\":\"QRIS\",\"payment_method_display_name\":\"Metode QRIS\",\"desc\":\"Bisa dibayar di semua e-wallet \\/ mbanking yang telah mendukung fitur pembayaran QRIS\"}]', 'Internet', NULL, ''),
(3, 'XL_XC1PLUS1DISC_PULSA', '[Method Pulsa] Xtra Combo 1+1GB Disc (Gandengan XUT Super 30000)', '- Ini bukan Xtra Combo Special ya.. Beda lagi...\r\n- XL Xtra Combo 1+1GB / 30 Hari harga murah/diskon. Kuota yang didapat akan bervariasi tergantung TKP/Area.\r\n- Dapat digunakan untuk syarat aktivasi Paket XL Xtra Unlimited Turbo Super (XUT SUPER) 30000\r\n- Kartu usahakan jangan posisi masa tenggang saat ditembak.\r\n- Sediakan Pulsa Rp12.500 (Akan terpotong segini).\r\n- Terdapat fee/biaya Admin (tertera) untuk mendukung sewa server kami.', 0, '[{\"order\":1,\"payment_method\":\"BALANCE\",\"payment_method_display_name\":\"Metode Pulsa (BALANCE)\",\"desc\":\"Langsung memotong pulsa kamu jika paket membutuhkan Pulsa (baca dan pahami deskripsi paketnya)\"}]', 'Internet', NULL, ''),
