(94, 'XLUNLITURBOTIKTOK_PULSA', '[Method Pulsa] Unlimited Turbo TikTok untuk Xtra Combo', '- Xtra Unlimited Turbo TikTok untuk akses TikTok ketika semua kuota utama paket habis.\r\n\r\n- Khusus untuk trik XUT Addon, silakan tembak paket ini sampai muncul notif \"Paket berhasil dibeli. Silakan cek kuotanya....\". JIKA NOTIF PERTAMA \"Paket berhasil dibeli. Silakan cek kuotanya....\" MAKA BERIKAN JEDA SEKITAR 10 MENIT.\r\n\r\nSEMBARI MENUNGGU 10 MENIT, KAMU MUNGKIN BISA LANJUT KE ADDON LAINNYA AGAR TIDAK SALING TUNGGU, INTINYA JIKA PERTAMA MUNCUL NOTIF \"Paket berhasil dibeli...\" maka tunggu juga selama 10 menit.\r\n\r\nSETELAH ITU, BELI LAGI HINGGA MUNCUL NOTIF \"422 -> Failed call ipaas purchase, with status code:422 : null,\" (DIPAKSA) DI MASING MASING ADDON. INI TUJUAN YANG KITA CARI-CARI, HARUS ADA RESPON 422 SEPERTI INI.\r\n\r\nDI PALING AKHIR JIKA SEMUA ADDON SUDAH DIRITUALKAN DAN DAPAT RESPON \"422 -> Failed call ipaas purchase, with status code:422 : null,\", TINGGAL GANDENG DENGAN XTRA COMBO SPECIAL 8GB, DAN TUNGGU SELAMA MAX 1-2 JAM NANTI SEMUA ADDON AKAN MASUK. SELAMA MASA TUNGGU 1-2 JAM, SEBAIKNYA JANGAN BELI PAKET APA-APA LAGI DULU.\r\n\r\nSEBELUM MELAKUKAN RITUAL DI ATAS, PASTIKAN TIDAK ADA XTRA COMBO APAPUN, WAJIB CEK VIAL DIAL *808# > INFO > INFO Kartu XL-Ku > Stop Langganan. Unreg sampai bersih dari berbau Xtra Combo 100GB, Xtra Combo Plus, Xtra Combo VIP Plus, Xtra Hotrod, dan sejenisnya (kalau Xtra Combo Flex biarkan saja).\r\n\r\n- Jika untuk trik XUT Addon, sebaiknya gunakan pulsa di bawah 10K (tetep nanti harus digandeng Xtra Combo Special 8GB).', 0, '[{\"order\":1,\"payment_method\":\"BALANCE\",\"payment_method_display_name\":\"Metode Pulsa (BALANCE)\",\"desc\":\"Langsung memotong pulsa kamu jika paket membutuhkan Pulsa (baca dan pahami deskripsi paketnya)\"}]', 'Internet', NULL, ''),
