(144, 'XLXCS8GB_PREV', 'XL Xtra Combo Special 8GB (1GB-8GB) 30 Hari Non Discount (Sedia Saldo Panel)', '- XL Xtra Combo Special Up to (hingga) 8 GB tergantung Area / 30 Hari harga normal. Kuota yang didapat akan bervariasi tergantung TKP/Area. Karena beda dengan paket akrab, maka kami tidak bisa memastikan dapat berapa GB, bisa dari 1GB hingga 8GB. Jangan kaget apabila nanti ada yang dapat kuota 1GB/2GB/3GB/4GB/5GB/6GB/7GB/8GB. Membeli = SETUJU ya.\r\n- Dapat digunakan untuk syarat aktivasi Paket XL Unlimited Turbo di aplikasi MyXL untuk kebutuhan inject/trik internet murah menggunakan SSH/VPN.\r\n- Kartu jangan posisi masa tenggang saat ditembak.\r\n- Terdapat fee/biaya Admin (tertera). Sediakan saldo panel untuk menembak, tidak perlu repot sediakan pulsa.', 0, '[{\"order\":1,\"payment_method\":\"BALANCE\",\"payment_method_display_name\":\"Metode Pulsa (BALANCE)\",\"desc\":\"Langsung memotong pulsa kamu jika paket membutuhkan Pulsa (baca dan pahami deskripsi paketnya)\"}]', 'Internet', NULL, ''),
(145, 'XLUNLITURBOIFLIXXC_EWALLET', '[Method E-Wallet] Unlimited Turbo iFlix untuk Xtra Combo (Bisa tanpa gandengan)', '- Xtra Unlimited Turbo iFlix untuk akses iFlix secara Unlimited.\r\n- Bisa tanpa gandengan.\r\n- Sediakan Saldo E-Wallet Rp25.000 (Akan terpotong segini).', 0, '[{\"order\":1,\"payment_method\":\"DANA\",\"payment_method_display_name\":\"Metode DANA\",\"desc\":\"Bisa dibayar dengan menggunakan E-Wallet DANA\"},{\"order\":2,\"payment_method\":\"QRIS\",\"payment_method_display_name\":\"Metode QRIS\",\"desc\":\"Bisa dibayar di semua e-wallet \\/ mbanking yang telah mendukung fitur pembayaran QRIS\"}]', 'Internet', NULL, ''),
(169, '3bb29c47f33d1f2e7df95a2aaafe55bc', '[METODE PULSA] XL DATA REGULER 1GB 2 HARI', 'MASA AKTIF PAKET 2 HARI\r\n\r\nSediakan pulsa Rp500 (akan terpotong Rp500) di kartu XL kamu (dan kunci/lock) untuk setiap kali tembak/eksekusi.\r\n\r\nHanya bisa untuk XL Prabayar/Prepaid.\r\n\r\nSISA KUOTA GAK BISA AKUMULASI (BERSIFAT REFILLABLE/ISI ULANG SAJA)\r\nKALAU MASA AKTIF PAKET BISA AKUMULASI.\r\n\r\nJIKA TIDAK BISA DITEMBAK ULANG, SILAKAN TUNGGU 2 HARI ATAU LEBIH KEMUDIAN COBA TEMBAK ULANG NANTI...', 0, '[{\"order\":1,\"payment_method\":\"BALANCE\",\"payment_method_display_name\":\"Metode Pulsa (BALANCE)\",\"desc\":\"Langsung memotong pulsa kamu jika paket membutuhkan Pulsa (baca dan pahami deskripsi paketnya)\"}]', 'Internet', NULL, ''),
(170, '160352d4a476320b7f78afe6e1829c1a', '[Method Pulsa] Xtra Combo Flex S Promo', '- Xtra Combo Flex S disc/versi murah.\r\n- Sediakan pulsa Rp15.000 (akan terpotong segini)\r\n- Jangan ada Paket Flex lainnya yang aktif.\r\n- Di sebagian kasus tidak dapat digandeng dengan Paket Akrab, jadi pastikan kalau mau lebih aman jangan ada paket akrabnya.\r\n- Terdapat fee/biaya Admin pembelian paket (tertera).\r\n- Bisa dipakai untuk Claim Addon/Bonus Xtra Combo Flex.', 0, '[{\"order\":1,\"payment_method\":\"BALANCE\",\"payment_method_display_name\":\"Metode Pulsa (BALANCE)\",\"desc\":\"Langsung memotong pulsa kamu jika paket membutuhkan Pulsa (baca dan pahami deskripsi paketnya)\"}]', 'Internet', NULL, ''),
