INSERT INTO `srv_donasi` (`id`, `code`, `category`, `service`, `note`, `note2`, `total_donasi`, `status`, `type`, `provider`) VALUES
(1, 'PS', 'Baitul Maal Hidayatullah', 'Peduli Sehat', 'Pedulisehat.id adalah sebuah wadah yang menawarkan layanan penggalangan dana secara online &amp; transparansi dan saat ini donasi kamu akan kami salurkan kepada para pasien Peduli Sehat yg menderita Kanker Darah atau Leukemia', '', 0, 'available', 'donasi', 'X'),
(2, 'YBN', 'Yayasan Berkah Nusantara', 'Yayasan Berkah Nusantara', 'Yayasan Berkah Nusantara mengajak teman-teman Neupay untuk membantu meningkatkan kualitas pendidikan di Indonesia. Mari berdonasi untuk membantu siswa di pesisir pantai agar tetap dapat melanjutkan pendidikan yang lebih baik.', '', 0, 'available', 'donasi', 'X'),
(3, 'NUCL', 'NU Care LAZISNU', 'NU Care LAZISNU', 'NU CARE-LAZISNU adalah lembaga yang berkhidmat untuk membantu kesejahteraan serta mengangkat harkat sosial masyarakat melalui pendayagunaan dana Zakat, Infaq, Shadaqah (ZIS) dan dana-dana Corporate Social Responsibility (CSR).', '', 10000, 'available', 'donasi', 'X'),
(4, 'LAZA', 'LAZ Al Azhar', 'LAZ Al Azhar', 'Lembaga Amil Zakat (LAZ) Al Azhar adalah satuan kerja yang dibentuk oleh Yayasan Pesantren Islam Al Azhar yang bertujuan untuk memberdayakan masyarakat dhuafa melalui optimalisasi dana Zakat, Infaq, Sedekah dan dana sosial kemanusiaan lainnya yang dibenarkan oleh syariat agama &amp; sumber daya yang ada di masyarakat dan bukan berorientasi pada pengumpulan profit bagi pengurus organisasi.', '', 0, 'available', 'donasi', 'X'),
(5, 'GF', 'Greeneration Foundation', 'Greeneration Foundation', 'Greeneration Foundation (GF) adalah lembaga swadaya masyarakat yang fokus dalam mengedepankan isu pengelolaan sampah dengan memanfaatkan media kreatif dan adaptif dalam meningkatkan perilaku manusia untuk menerapkan prinsip konsumsi dan produksi yang berkelanjutan.', 'Kami sadar tidak dapat maju sendiri menjawab tantangan kerusakan lingkungan. Bantuan dan dukungan dari publik sangat kami harapkan demi terwujudnya perbaikan lingkungan melalui tata kelola persampahan yang berkelanjutan. Dengan membantu setiap upaya dan program-program yang kami lakukan Anda sudah ikut serta menjadi bagian dari #GenerasiHijau dalam mewujudkan perbaikan lingkungan dan perwujudan tata ke lola sampah yang berkelanjutan, serta menciptakan hari ini dan masa depan yang lebih baik.', 0, 'available', 'donasi', 'X'),
(6, 'LAZR', 'LAZ RYDHA', 'LAZ RYDHA', 'Lembaga filantropi pengelola zakat, infak dan sedekah dengan moto menyayangi yatim, memberdayakan dhuafa dan mencetak insan sukses mulia, melalui budaya kerja yang istiqomah, jujur, amanah, profesional dan lebih bermanfaat (IJAP+).', '', 0, 'available', 'donasi', 'X'),
(7, 'YAI', 'Yayasan Anyo Indonesia', 'Yayasan Anyo Indonesia', 'Yayasan Anyo Indonesia (YAI), sebuah yayasan sosial nirlaba yang mewadahi para pejuang kanker anak, terutama dari keluarga pra-sejahtera di Indonesia, untuk terus berjuang melawan kanker.', 'YAI memiliki visi ingin bergandengan tangan bersama semua pihak yang peduli untuk menolong anak-anak dengan kanker. Sedangkan misinya adalah untuk meringankan beban keluarga anak-anak dengan kanker.', 0, 'available', 'donasi', 'X'),
(8, 'PPPADQ', 'PPPA Darul Quran', 'PPPA Darul Quran', 'PPPA Daarul Quran sebagai Lembaga Zakat Nasional (Laznas) berdasarkan SK Menteri Agama RI No. 367 Tahun 2018, bergerak dalam pengelolaan dana Ziswaf (Zakat, infak, sedekah dan wakaf) dan dana sosial keagamaan Islam lainnya untuk dikelola secara komprehensif dalam melahirkan sebanyak-banyaknya penghafal Al Quran. Insya Allah, himpunan Ziswaf akan kami salurkan untuk para penerima manfaat seperti, program pembibitan penghafal AL Quran yang tersebar di setiap Rumah Tahfidz, Pesantren Takhassus (dhuafa), Beasiswa Tahfidz Quran (BTQ) serta untuk penangangan kemiskinan dan pemberdayaan mustahiq berbasis tahfidzul Quran. Semoga ikhtiar mulia ini menjadi pembuka pintu surge serta membawa kemanfaatan bagi umat, guna mencetak generasi Qurani.', '', 0, 'available', 'donasi', 'X'),
(9, 'BB', 'BenihBaik #SelaluAdaKebaikan', 'BenihBaik #SelaluAdaKebaikan', 'Mengacu pada pilar pertama, kedua dan ketiga 17 Sustainable Development Goals dari United Nations, bahwa setiap pihak wajib untuk:\r\n1. Mengakhiri kemiskinan dimanapun dan dalam semua\r\nbentuk\r\n2. Mengakhiri kelaparan, mencapai ketahanan pangan dan nutrisi yang lebih baik dan mendukung pertanian berkelanjutan\r\n3. Memastikan kehidupan yang sehat dan mendukung kesejahteraan bagi semua untuk semua usia.', 'Melalui program BenihBaik #SelaluAdaKebaikan, donasi yang terkumpul akan dimanfaatkan untuk:\r\n1. 1000 Paket untuk Dhuafa (Baju Lebaran, Alat Sholat, dan Paket Sembako)\r\n2. Sahur Sejahtera\r\n3. Iftar untuk Mereka', 348940, 'available', 'donasi', 'X'),
(13, 'STC', 'Save The Children', 'Save The Children', 'Save the Children merupakan sebuah organisasi non-pemerintah internasional yang mendukung hak-hak anak, menyediakan bantuan, dan membantu mendukung anak-anak di seluruh dunia.', 'Save the Children di Indonesia telah hadir sejak 1976 kini hadir di 12 provinsi untuk berkontribusi dalam pemenuhan hak anak. Kami memastikan setiap anak dapat memiliki tumbuh kembang yang baik sejak dalam kandungan. Save the Children Indonesia berupaya untuk memberikan dan memastikan setiap anak mendapatkan pendidikan yang berkualitas serta mendapatkan perlindungan dari segala bentuk kekerasan anak bahkan hingga ke pelosok Indonesia.', 0, 'available', 'donasi', 'X'),
(10, 'YWWFI', 'Yayasan WWF Indonesia', 'Yayasan WWF Indonesia', 'Hadir sejak 1962 Yayasan WWF Indonesia, berfokus pada tata kelola sumber daya alam yang adil untuk menjamin manfaat konservasi di masa depan:\r\nâ€œEkosistem dan keanekaragaman hayati Indonesia lestari, berkelanjutan dan terkelola secara adil, untuk kesejahteraan generasi kini dan nantiâ€.', 'Jadilah bagian dari WWF Warrior melalui Aksi kecil untuk perubahan besar, dengan menyuarakan pesan konservasi, melakukan penggalangan dana (fundraising) dan mengajak publik untuk turut serta berpartisipasi melestarikan alam untuk bumi yang lestari.', 0, 'available', 'donasi', 'X'),
(11, 'RZ', 'Rumah Zakat #SedekahYatimPenghafalQuran', 'Rumah Zakat #SedekahYatimPenghafalQuran', 'Rumah Zakat mengajak sahabat semua untuk anak- anak penghafal Quran lainnya melalui â€˜Sedekah Yatim Penghafal Quranâ€™ . Insya Allah dengan membantu anak yatim dan dhuafa penghafal Al Quran, semoga bisa menjadi pahala yang terus mengalir hingga akhirat.', 'Sebagaimana yang disebutkan dalam Al-Quran bahwa anak yatim adalah sosok yang harus dipelihara, dikasihi dan diperhatikan. Allah berfirman dalam hadist keutamaan untuk menyayangi anak yatim: â€œMereka bertanya kepadamu tentang anak yatim, katakan lah â€œMemperbaiki keadaan mereka adalah baik,â€ (QS. Al-Baqarah [2]: 220).', 0, 'available', 'donasi', 'X'),
(12, 'RY', 'Rumah Yatim', 'Rumah Yatim', 'Rumah Yatim berangkat dari keinginan untuk membantu anak-anak dari kerabat dekat yang kehilangan orangtuanya. Berbekal niat yang kuat dan dukungan sosial dari para tetangga di sekitar rumah kerabat tersebut, pertolongan kemudian diberikan untuk anak-anak kerabat. Perlahan-lahan, keinginan dan permintaan untuk menolong anak yatim dan dhuafa lainnya kian meningkat hingga akhirnya diputuskan untuk membentuk suatu lembaga formal yang dikhususkan untuk memberikan pengasuhan bagi anak-anak yang kurang beruntung di daerah Bandung dan sekitarnya.', 'Beberapa tahun setelahnya, Rumah Yatim tumbuh menjadi salah satu institusi sosial yang legal serta profesional untuk senantiasa memberikan pelayanan dan pengasuhan kepada anak-anak yatim dan dhuafa yang kurang beruntung. Hal ini dilakukan agar mereka tetap dapat mengembangkan potensi dan meraih masa depan yang mereka inginkan walaupun terhalang oleh segala keterbatasan yang mereka miliki.', 0, 'available', 'donasi', 'X'),
(14, 'BAZNAS', 'BAZNAS #PeduliKemanusiaan', 'BAZNAS #PeduliKemanusiaan', 'Kuartal II Tahun 2021 ini dipenuhi oleh polemik isu kemanusiaan yang membara. Tentunya, sebagai sesama manusia, kita ingin terus membantu memecahakan permasalahan kemanusiaan ini.', 'Mari bersama bantu saudara-saudara kita yang menjadi korban dari isu kemanusiaan dengan menyisihkan sebagian harta kita. Setiap donasi yang kita berikan Insyaa Allah akan mendatangkan pahala yang tidak terputus.', 10000, 'available', 'donasi', 'X'),
(15, 'KB', 'Kitabisa', 'Kitabisa', 'Kitabisa terus bertumbuh menjadi platform galang dana dan donasi online terbesar dan terpercaya di Indonesia. Kitabisa memfasilitasi jutaan orang baik untuk menyalurkan kebaikan kepada orang yang membutuhkan secara mudah, cepat, dan transparan. Dengan menggunakan teknologi dan terus berinovasi, Kitabisa percaya jutaan orang Indonesia bisa menghasilkan kebaikan dan dampak sosial dalam skala besar untuk menciptakan Indonesia yang lebih baik.', '', 7070000, 'available', 'donasi', 'X'),
(16, 'DD', 'Dompet Dhuafa', 'Dompet Dhuafa', 'Dompet Dhuafa adalah Lembaga Filantropi Islam bersumber dari dana Zakat, Infak, Sedekah dan Wakaf (ZISWAF) dan dana halal lainnya yang berkhidmat dalam pemberdayaan kaum dhuafa dengan pendekatan budaya melalui kegiatan filantropis (humanitarian) dan wirausaha sosial profetik (prophetic socio-technopreneurship) Dompet Dhuafa akan terus mewujudkan masyarakat berdaya yang bertumpu pada sumber daya lokal melalui sistem yang berkeadilan.', '', -92999, 'available', 'donasi', 'X'),
(17, 'GZACT', 'Global Zakat ACT', 'Global Zakat ACT', 'Ramadhan ini bertepatan dengan pandemi COVID-19. Hal ini mengakibatkan hampir semua lapisan masyarakat terkena imbasnya, terlebih bagi golongan rentan seperti para pekerja harian dan keluarga pra sejahtera. Berkurangnya pendapatan dan kelangkaan bahan pangan membuat banyak dari saudara kita masih harus menahan lapar bahkan di saat buka puasa.', 'Didasari dengan kondisi tersebut, Global Zakat menginisiasi program donasi bahan pangan pokok. Aksi ini sebagai jawaban tepat dan cepat untuk menanggulangi kondisi terkini bagi saudara kita yang membutuhkan.\r\nMari jadi hebat dengan tunaikan zakat di awal waktu darurat!\r\n#BersamaSelamatkanBangsa', 12000, 'available', 'donasi', 'X'),
(18, 'HI', 'Human Initiative', 'Human Initiative', 'Pada 22 Juli 2008, PKPU terdaftar di PBB sebagai NGO dengan â€œSpecial Consultative Status with the Economic Social Councilâ€. Pada 29 Januari 2010, PKPU resmi terdaftar sebagai Organisasi Sosial Nasional berdasarkan Keputusan Menteri RI No. 08/Huk/2010, serta pada 8 Oktober 2010 terdaftar di UNI Eropa dengan nomor registrasi EuropeAid ID No. 2010-CSD-1203198618. Setelah melakukan spin off pada awal tahun 2016, PKPU berfokus mengelola dana kemanusiaan, dan pada akhir tahun 2016 merubah nama menjadi PKPU Human Initiative.', '', 0, 'available', 'donasi', 'X'),
(19, 'LAZ', 'Lazismu', 'Lazismu', 'Lazismu adalah lembaga zakat tingkat nasional yang berkhidmat dalam pemberdayaan masyarakat melalui pendayagunaan secara produktif dana zakat, infaq, wakaf, dan dana sosial lainnya, baik dari perseorangan, lembaga, perusahaan, maupun instansi lainnya.', '', 0, 'available', 'donasi', 'X'),
(20, 'IZI', 'Inisiatif Zakat Indonesia', 'Inisiatif Zakat Indonesia', 'Didirikan pada tanggal 10 November 2014, Inisiatif Zakat Indonesia dikukuhkan menjadi Lembaga Amil Zakat Nasional (LAZNAS) dengan izin resmi oprasional pada 30 Desember 2015 melalui Keputusan Mentri Agama Indonesia No. 423 tahun 2015. Inisiatif Zakat Indonesia juga berperan aktif dalam membantu pemerintah mengentaskan kemiskinan dan menyejahterkan umat. Beberapa program unggulan yang digagas IZI pun sangat dirasakan manfaatnya oleh mustahik, seperti Rumah Singgah Pasien (RSP) sebagai penginapan gratis pasien yang sedang menjalani pengobatan di rumah sakit rujukan.', '', 1000, 'available', 'donasi', 'X'),
(21, 'WVI', 'Wahana Visi Indonesia', 'Wahana Visi Indonesia', 'Wahana Visi Indonesia (WVI) adalah yayasan sosial kemanusiaan Kristen yang berperan dalam menciptakan perubahan yang berkesinambungan pada kehidupan anak, keluarga, dan masyarakat yang hidup dalam kemiskinan tanpa membedakan agama, ras, etnis, dan jenis kelamin.', '', 0, 'available', 'donasi', 'X'),
(22, 'BMH', 'Baitul Maal Hidayatullah', 'Baitul Maal Hidayatullah', 'Baitul Maal Hidayatullah (BMH) merupakan lembaga amil zakat yang bergerak dalam penghimpunan dana Zakat, Infaq, Sedekah, Wakaf, dan dana lainnya serta fokus dalam pembinaan melalui program pendidikan, dakwah, ekonomi, sosial, dan kemanusiaan.', '', 22200, 'available', 'donasi', 'X'),
(23, 'RHI', 'Rumah Harapan Indonesia', 'Rumah Harapan Indonesia', 'RHI adalah rumah singgah untuk anak-anak sakit (usia 0-17 tahun) dari keluarga tidak mampu yang berasal dari luar Jakarta, yang dirujuk untuk berobat atau rawat jalan di rumah sakit di Jakarta.', '', 0, 'available', 'donasi', 'X'),
(24, 'MI', 'Mercy Indonesia', 'Mercy Indonesia', 'Mercy Indonesia memiliki 12 panti asuhan &amp; 3 pusat bantuan anak-anak di seluruh Indonesia untuk membantu anak-anak yatim piatu yang terlantar setelah bencana alam dan memberikan dukungan di bidang pendidikan, psikologis,serta spiritual.', '', 0, 'available', 'donasi', 'X'),
(25, 'PAF', 'Peduli Anak Foundation', 'Peduli Anak Foundation', 'Peduli Anak Foundation memiliki tujuan mulia untuk memberikan kesempatan hidup yang lebih baik &amp; melindungi hak anak-anak untuk mendapatkan pendidikan, akomodasi, serta bantuan kesehatan terutama untuk anak-anak yatim piatu yang terlantar di Lombok.', '', 0, 'available', 'donasi', 'X');
